INSERT INTO `start_question` VALUES (11,'十九大召开的时间是（）','2017年10月18日至10月24日','2017年11月18日至11月24日','2012年11月8日11月14日','2016年10月24日至10月27日','1'),(12,'2017年10月18日，中国共产党第十九次全国代表大会在北京胜利召开。此次大会的主题是：（ ）','不忘初心，牢记使命，高举中国特色社会主义伟大旗帜，决胜全面建成小康社会，夺取新时代中国特色社会主义伟大胜利，为实现中华民族伟大复兴的中国梦不懈奋斗。','高举中国特色社会主义伟大旗帜，决胜全面建成小康社会，夺取新时代中国特色社会主义伟大胜利，为实现中华民族伟大复兴的中国梦不懈奋斗。','不忘初心，继续前进，高举中国特色社会主义伟大旗帜，决胜全面建成小康社会，夺取新时代中国特色社会主义伟大胜利，为实现中华民族伟大复兴的中国梦不懈奋斗。','高举中国特色社会主义伟大旗帜，不忘初心，继续前进，决胜全面建成小康社会，夺取新时代中国特色社会主义伟大胜利，为实现中华民族伟大复兴的中国梦不懈奋斗。','1'),(13,'中国共产党第十九次全国代表大会，是在全面建成小康社会决胜阶段、中国特色社会主义进入（）的关键时期召开的一次十分重要的大会。','新时期','新阶段','新征程','新时代','4'),(14,'中国共产党人的初心和使命，就是为中国人民（），为中华民族（）。这个初心和使命是激励中国共产党人不断前进的根本动力。','谋幸福，谋未来','谋生活，谋复兴','谋幸福，谋复兴','谋生活，谋未来','3'),(15,'十九大报告中指出，全党同志一定要永远与人民同呼吸、共命运、心连心，永远把（）作为奋斗目标。','人民对美好生活的向往','实现最广大人民的利益','为中国人民谋幸福、为中华民族谋复兴','实现共产主义','1'),(16,'中国共产党第十九次全国代表大会，是在全面建成小康社会（）阶段、中国特色社会主义进入新时代的（）时期召开的一次十分重要的大会。','决胜、关键','发展、决胜','关键、决胜','发展、关键','1'),(17,'十九大报告指出，中国特色社会主义进入新时代，我国社会主要矛盾已经转化为（）','人民日益增长的美好生活需要和不平衡不充分的发展之间的矛盾','人民日益增长的物质文化需要和不平衡不充分的发展之间的矛盾','人民日益增长的美好生活需要和落后的社会生产的矛盾','人民日益增长的物质文化需要和落后的经济发展的矛盾','1'),(18,'实施共建“一带一路”倡议，发起创办亚洲基础设施投资银行，设立丝路基金，举办首届“一带一路”国际合作高峰论坛、亚太经合组织领导人非正式会议、二十国集团领导人（）峰会、金砖国家领导人（）会晤、亚信峰会。','北京　南京','杭州　厦门','南京　北京','厦门　杭州','2'),(19,'经过长期努力，中国特色社会主义进入了新时代，这是我国发展新的（）。','未来方向','未来方位','历史方向','历史方位','4'),(20,'必须认识到，我国社会主要矛盾的变化，没有改变我们对我国社会主义所处历史阶段的判断，我国仍处于并将长期处于（）的基本国情没有变，我国是世界最大发展中国家的国际地位没有变。','社会主义阶段','社会主义初级阶段','社会主义中级阶段','社会主义高级阶段','2'),(21,'十九大报告里，面对世界经济复苏乏力、局部冲突和动荡频发、全球性问题加剧的外部环境，面对我国经济发展进入新常态等一系列深刻变化，我们坚持（）工作总基调，迎难而上，开拓进取，取得了改革开放和社会主义现代化建设的历史性成就。','稳中求进','五位一体','四个全面','依法治国','1'),(22,'十九大报告中提到，经济保持中高速增长，在世界主要国家中名列前茅，国内生产总值从（）万亿元增长到（）万亿元，稳居世界第（），对世界经济增长贡献率超过百分之（）。','55、85、2、30%','54、80、2、30%','52、62、1、40%','55、80、1、40%','2'),(23,'十九大报告中提到，农业现代化稳步推进，粮食生产能力达到（）斤。','一万二千亿','三万一千亿','一百五十万','二百九十万','1'),(24,'十九大报告指出，区域发展协调性增强，三大区域发展战略成效显著，其中三大区域发展战略分别是（）','全面协调可持续、京津冀协同发展、“一带一路”建设','“一带一路”建设、京津冀协同发展、长江经济带发展','对外开放、健康中国、长江经济带发展','“一带一路”建设、人才优先、创新驱动发展','2'),(25,'新时代中国特色社会主义思想，明确坚持和发展中国特色社会主